import React, { Fragment } from "react";
import Test from "./test";
import Task2 from "./components/Task2";
const App = () => {
  const mapConfig = {
    lat: 22,
    lng: -72,
    zoom: 6
  };

  return (
    <Fragment>
        <div id="map-wrapper">
            <Task2  />
            <Test />
            <button style={{
                zIndex:4000000, position:'fixed',
                top:'80px',
                left:'10px',
                background:'Yellow',
                padding:'100px'
            }}>Edit</button>
        </div>
    </Fragment>
  );
};

export default App;
